for key, value in self.known_values.items():
    if type(value) == int or type(value) == float:
        self.assertAlmostEqual(value, self.obj_pars[key])
    elif value.any() and type(value) != dict:
        for num, item in enumerate(value):
            message = '%s: known value = %s; obj_attribute = %s' % (key,
                value[:150], self.obj_pars[key][:150])
            if type(item) == float or type(item) == numpy.float64:
                self.assertAlmostEqual(round(self.obj_pars[key][num], 8),
                    round(item, 8), message)
            else:
                self.assertAlmostEqual(self.obj_pars[key][num], item, message)
